import { useHistory, Switch, Route, Link, NavLink } from "react-router-dom";

function DeckViewHome({deck, browserHistory, editUrl}) {
    return (
        <div className="border p-4 h-100 d-flex flex-column">
            <h2 className="font-weight-lighter flex-fill">
                {deck['name']}
            </h2>
            <p>
                {deck['description']}
            </p>
            <nav>
                <ul>
                    <li>
                        <button
                            type="button"
                            onClick={() => {browserHistory.push(editUrl)}}
                        >Edit</button>
                    </li>
                    <li>
                        <button>Study</button>
                    </li>
                    <li>
                        <button>Add Cards</button>
                    </li>
                    <li>
                        <button className="btn btn-danger">Delete</button>
                    </li>
                </ul>
            </nav>
        </div>
    );
}

export default DeckViewHome;
